import React, { Component } from 'react'
import {Paper, Container, Box , TextField} from '@material-ui/core'

export default class Login extends Component {
    render() {
        return (
            <Container>
                <Box>
                   <Paper  className="col-5 mt-5 offset-3 justify-content-center " elevation={3}>

                   <form className="mt-5" noValidate autoComplete="off">
  <TextField id="standard-basic" label="Enter your Username" />

</form>
                   </Paper>
                </Box>
            </Container>
        )
    }
}
